import React, { useState, useEffect } from "react";
import { database } from "../services/appwriteConfig";
import "./card.scss";

const Card = () => {
  const [foodDetails, setFoodDetails] = useState({
    type: "",
    for: "",
    weight: "",
    location: "",
  });

  useEffect(() => {
    const getFoods = async () => {
      try {
        const getFoods = await database.listDocuments(
          "63269b368ea087325d9c",
          "63269baf43c60b1a2ec9"
        );
        console.log(getFoods);
        foodDetails.type = getFoods.documents[0].type;
        foodDetails.for = getFoods.documents[0].for;
        foodDetails.weight = getFoods.documents[0].weight;
        foodDetails.location = getFoods.documents[0].location;
        console.log(foodDetails);
      } catch (error) {
        console.log(error);
      }
    };
    getFoods();
  }, []);

  return (
    <div className="Card">
      {foodDetails.map((food) => {
        return (
          <div className="Card-Container">
            <h1>{food.type}</h1>
            <p>{food.for}</p>
            <p>{food.weight}</p>
            <p>{food.location}</p>
          </div>
        );
      })}
    </div>
  );
};

export default Card;
